import React,{useState} from 'react'

function Home() {
    const [seats,setSeats] = useState('')
    const clickHandler = (e)=>{
        e.preventDefault()
    }
    return (
        <React.Fragment>
            <form>
                <input type="text" name="row" id="row_num" value={seats} onInput={(e)=>{setSeats(e.target.value)}} placeholder='Enter The Number Of Rows'/>
                <button type='submit' onClick={clickHandler}>Get Sets</button>
            </form>
        </React.Fragment>
    )
}

export default Home
